'''纱露朵'''是'''[[SEGA]]'''旗下游戏《[[maimai]]》系列中的登场角色，于《maimai MiLK》中首次登场。

== 简介 ==
于'''maimai MiLK'''登场，为本作主人公之一。

是一只住在满是毛茸茸的国家"大吉嶺"的一只猫，本业是面包师傅，在半年前<del>MURASAKi升级MURASAKi PLUS的时候</del>遇见了兔子[[拉兹]]，并且到了他的店里工作。

{{黑幕|取名来源为英文的盐巴(Salt)。}}

发色与瞳色对应至历代作品《maimai MURASAKi》，而穿着则是对应至《maimai无印版本》。(中国大陆地区曾经有过这个版本，后来因为代理商倒闭而无法继续经营，中国大陆称为"舞萌"。)

